import React from "react";

function Card({key, card}) {
    return (
        <article className="element" key={key}>
            <button type="button" className="elements__delete-btn"></button>
            <img className="elements__image" src={props.card.link} alt={`${props.card.name}`} />
            <div className="elements__container">
                <h2 className="elements__title">{props.card.name}</h2>
                <div className="elements__container-likes">
                    <button className="elements__like-btn" type="button"></button>
                    <p className="elements__like-count">{props.card.likes}</p>
                </div>
            </div>
        </article>
    );
}

export default Card;
